import React from "react";
import { Link } from "react-router-dom"
import "./Modal.css";

function Modal(){
    return <div className="nav">
        <Link to="/">Home</Link>
        <Link to="/about">About</Link>
        <Link to="/about">About</Link>
        <Link to="/about">About</Link>
        <Link to="/about">About</Link>
        <Link to="/about">About</Link>
        <Link to="/about">About</Link>
        <Link to="/about">About</Link>
    </div>
}

export default Modal;
